      case 0:
        return <h1>0</h1>;
        break;
      case 1:
        return <h1>0</h1>;
        break;
      default:
        return <h1>0</h1>;

        break;
    }
  }
  return (
    <div className="App">
      <Content />
    </div>
  );
}

export default App;
